def widthratio(value, max_value, max_width):

    ratio = float(value) / float(max_value)
    return int(round(ratio * max_width))

def prime_factors(n):

    i = 2; factors = []
    while i * i <= n:
        if n % i:
            i += 1
        else:
            n //= i
            factors.append(i)
    if n > 1:
        factors.append(n)
    return factors

