def clip_pad(boxes, pad_shape):

    H, W = boxes.shape[2:]
    h, w = pad_shape
    if h < H:
        boxes = boxes[:, :, :h, :].copy()
    if w < W:
        boxes = boxes[:, :, :, :w].copy()
    return boxes

