def get_neighbors(matrix, position):

    row, col = position
    rows = len(matrix)
    cols = len(matrix[0])
    neighbors = set()
    # calculate the neighbors for a given point in the 2D space
    if row-1 != -1:
        neighbors.add((row-1, col))
    if col-1 != -1:
        neighbors.add((row, col-1))
    if row+1 <= rows-1:
        neighbors.add((row+1, col))
    if col+1 <= cols-1:
        neighbors.add((row, col+1))
    return neighbors

