        lastdigit = 0                                               # O(1)
        if i > 0:                                                   # O(1)
            lastdigit = A[i - 1]                                    # O(1)
        total -= (A[i] + lastdigit)                                 # O(1)
        if total == 0:                                              # O(1)
            return i                                                # O(1)
        i += 1                                                      # O(1)
